const Bin = () => {
  return (
    <div className="sticky-bin-container">
      <div className="container">
        <div className="row">
          {/* Main content */}
          <div className="col-md-8">
            {/* Your main content here */}
          </div>

          {/* Sticky bin */}
          <div className="col-md-4">
            <div className="sticky-bin">
              <h3>Корзина</h3>
              {/* Your bin items here */}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Bin;
